import { Component } from '@angular/core';
import { InfoSectionComponent } from '@app/shared/components/info-section/info-section.component';
import { NgxShineBorderComponent } from '@omnedia/ngx-shine-border';

@Component({
  selector: 'app-portfolio',
  standalone: true,
  imports: [InfoSectionComponent, NgxShineBorderComponent],
  templateUrl: './portfolio.component.html',
  styleUrl: './portfolio.component.scss',
})
export class PortfolioComponent {}
<om-shine-border>
  <app-info-section
    headline="Lincoln Township Local Government Website"
    copy="We provide amazing services to help your business grow."
    imageSrc="../../../../../assets/jpg/LincolnTownship.jpeg"
    imageAlt="Description of the image"
  ></app-info-section>
</om-shine-border>
